import React from "react";
import ReactDOM from "react-dom";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import "./reset.css";

//bootstrap 사용
import "bootstrap/dist/css/bootstrap.css";
import "bootstrap/dist/css/bootstrap.min.css";

//layout
import CusLayout from "./layout/CusLayout";
import ManagerLayout from "./layout/ManagerLayout";

//page 연결
import NotFound from "./pages/NotFound";

import LoginPage from "./pages/LoginPage";

import CusMainPage from "./pages/cus/CusMainPage";
import CusOrderPage from "./pages/cus/CusOrderPage";
import CusAsPage from "./pages/cus/CusAsPage";
import CusTalkPage from "./pages/cus/CusTalkPage";

import ManMainPage from "./pages/man/ManMainPage";
import ManCusPage from "./pages/man/ManCusPage";
import ManAsPage from "./pages/man/ManAsPage";
import ManTalkPage from "./pages/man/ManTalkPage";
import ManCalllistPage from "./pages/man/ManCalllistPage";
import ManCallmissPage from "./pages/man/ManCallmissPage";
import ManCallonePage from "./pages/man/ManCallonePage";
import ManCallDetailsPage from "./pages/man/ManCallDetailsPage"; // 새로운 페이지 추가

const root = ReactDOM.createRoot(document.getElementById("root"));

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<CusLayout />}>
          <Route index element={<CusMainPage />} />
          <Route path="order" element={<CusOrderPage />} />
          <Route path="as" element={<CusAsPage />} />
          <Route path="talk" element={<CusTalkPage />} />
          <Route path="login" element={<LoginPage />} />
        </Route>
        <Route path="/manager" element={<ManagerLayout />}>
          <Route index element={<ManMainPage />} />
          <Route path="cus" element={<ManCusPage />} />
          <Route path="as" element={<ManAsPage />} />
          <Route path="talk" element={<ManTalkPage />} />
          <Route path="calllist" element={<ManCalllistPage />} />
          <Route path="callmiss" element={<ManCallmissPage />} />
          <Route path="callone" element={<ManCallonePage />} />
          <Route path="call/:id" element={<ManCallDetailsPage />} />
        </Route>
        <Route path="*" element={<NotFound />} />
      </Routes>
    </Router>
  );
};

root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
